import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart, faCcVisa, faCreditCard } from '@fortawesome/free-solid-svg-icons';

export default class HeaderTransaction extends React.Component {
	render() {
		return (
			<div>
				<div
					style={{
						display: 'block',
						marginRight: 'auto',
						marginLeft: 'auto',
						backgroundColor: '#F1F4F5',
						width: '20rem',
						borderBottom: 0
					}}
				>
					<FontAwesomeIcon size="1x" style={{ color: '#218838' }} icon={faCreditCard} />
				</div>
			</div>
		);
	}
}
